import { Jumbotron } from "react-bootstrap";
import { Content } from "react-bootstrap/lib/Tab";

const Note = ({ name, content }) => {
  return (
    <Jumbotron className={name}>
      <p className="note-content">{content}</p>
    </Jumbotron>
  );
};

export default Note;
